import React from "react";
import { FaArrowDown, FaArrowUp } from "react-icons/fa";

const CompletedProjects = (projects, onShowProjects, showProjects) => {
  console.log(projects);
  return (
    <div>
      <h2
        className="main"
        onClick={onShowProjects}
        style={{ color: "white", backgroundColor: "black" }}
      >
        Completed Projects {showProjects ? <FaArrowUp /> : <FaArrowDown />}
      </h2>
      {projects.length > 0 ? (
        projects.map(
          (project) =>
            showProjects && (
              <div className="main">
                <h3>{project.text}</h3>
              </div>
            )
        )
      ) : (
        <h3 className="main" style={{ backgroundColor: "#f4f4f4" }}>
          No Projects
        </h3>
      )}
    </div>
  );
};

export default CompletedProjects;
